import React from "react";
import { Card } from "./Card";

const AircraftCard = ({ name, percentage = 0 }) => {

    return (
        <Card>
            <h3>{name}</h3>
            <p>{`${percentage} %`}</p>
        </Card>
    );
};

export default AircraftCard;
